/// <summary>
/// Resource setup contract object which is used to get and set <c>ResourceSetup</c> form parameters.
/// </summary>
class ResResourceSetupContract
{
    private utcdatetime asOfDateTimeWithTimeZone;
    private utcdatetime asOfDateTimeWithoutTimeZone;

}

Method.Source:
public utcdatetime parmAsOfDateTimeWithTimeZone(utcdatetime _asOfDateTime = asOfDateTimeWithTimeZone)
{
    asOfDateTimeWithTimeZone = _asOfDateTime;

    return asOfDateTimeWithTimeZone;
}

public utcdatetime parmAsOfDateTimeWithoutTimeZone(utcdatetime _asOfDateTime = asOfDateTimeWithoutTimeZone)
{
    asOfDateTimeWithoutTimeZone = _asOfDateTime;

    return asOfDateTimeWithoutTimeZone;
}
